import React from 'react';
import { withNavigation } from '@react-navigation/compat';
import PropTypes from 'prop-types';

import { 
    AsyncStorage,
    Dimensions,
    StyleSheet, 
    Image, 
    TouchableWithoutFeedback 
} from 'react-native';

import { Block, Button, Text, theme, Icon } from 'galio-framework';

import { nowTheme } from '../constants';

import ContentDetail from './ContentDetail';

const { height, width } = Dimensions.get("screen");

class DetailMVList extends React.Component {
  render() {
    const {
      navigation,
      item,
      horizontal,
      full,
      style,
      ctaColor,
      imageStyle,
      ctaRight,
      titleStyle,
      category_template
    } = this.props;

    const imageStyles = [full ? styles.fullImage : styles.horizontalImage, imageStyle];
    const titleStyles = [styles.cardTitle, titleStyle];
    const cardContainer = [styles.card, styles.shadow, style];
    const imgContainer = [
      styles.imageContainer,
      horizontal ? styles.horizontalStyles : styles.verticalStyles,
      styles.shadow
    ];

    return (
      <Block card flex style={cardContainer}>
        <TouchableWithoutFeedback 
          onPress={() => navigation.navigate('Workpack Detail', {
            title: item.template,
            id: item.id,
            category_template: category_template,
          })}
        >
          <Block style={styles.cardDescription}>
            <Block>
                <Block>

                    <Block style={{ paddingRight: 0 }}>
                      <Block style={{paddingBottom: 20}}>
                        <Text
                            style={{ 
                                fontFamily: 'montserrat-bold', 
                            }}
                            size={15}
                            color={nowTheme.COLORS.SECONDARY}
                        >
                            {  ' Piecemark No : ' + item.template}
                        </Text>
                      </Block>

                      <ContentDetail
                        title='Rev AS'
                        content={item.rev_as}
                      />

                      <ContentDetail
                        title='Material'
                        content={item.material}
                      />

                      <ContentDetail
                        title='Profile'
                        content={item.profile}
                      />

                      <ContentDetail
                        title='Grade'
                        content={item.grade}
                      />

                      <ContentDetail
                        title='Weight'
                        content={item.weight}
                      />

                      <ContentDetail
                        title='Progress'
                        content={item.progress + ' %'}
                      />

                    </Block>                    

                </Block>

            </Block>

          </Block>
        </TouchableWithoutFeedback>
      </Block>
    );
  }
}

DetailMVList.propTypes = {
  item: PropTypes.object,
  horizontal: PropTypes.bool,
  full: PropTypes.bool,
  ctaColor: PropTypes.string,
  imageStyle: PropTypes.any,
  ctaRight: PropTypes.bool,
  titleStyle: PropTypes.any,
  textBodyStyle: PropTypes.any
};

const styles = StyleSheet.create({
  card: {
    backgroundColor: theme.COLORS.WHITE,
    marginVertical: theme.SIZES.BASE,
    borderWidth: 0,
    minHeight: 80,
    marginBottom: 4
  },
  cardTitle: {
    paddingHorizontal: 9,
    paddingTop: 7,
    paddingBottom: 15,
    textAlign: 'center',
  },
  cardDescription: {
    padding: theme.SIZES.BASE / 1
  },
  imageContainer: {
    borderRadius: 3,
    elevation: 1,
    overflow: 'hidden'
  },
  image: {
    // borderRadius: 3,
  },
  horizontalImage: {
    height: 122,
    width: 'auto'
  },
  horizontalStyles: {
    borderTopRightRadius: 0,
    borderBottomRightRadius: 0
  },
  verticalStyles: {
    borderBottomRightRadius: 0,
    borderBottomLeftRadius: 0
  },
  fullImage: {
    height: 215
  },
  shadow: {
    shadowColor: '#8898AA',
    shadowOffset: { width: 0, height: 1 },
    shadowRadius: 6,
    shadowOpacity: 0.1,
    elevation: 2
  },
  articleButton: {
    fontFamily: 'montserrat-bold',
    paddingHorizontal: 9,
    paddingVertical: 7
  }
});

export default withNavigation(DetailMVList);
